import React from "react";
import styled from "styled-components";

const FormContainer = styled.form`
    display: flex;
    align-items: flex-end;
    gap: 10px;
    flex-wrap: wrap;
    background-color; 
`


const Form = () => {
    return(
        <FormContainer>

        </FormContainer>
    );
}

export default Form;
